import React from 'react';
import './Spinner.css';

const Spinner = props => {
  const { x, y } = props.position;

  return (
    <div className="spinner-container" style={{transform: `translate(${x}px, ${y}px);`}}>
      <div className="lds-ripple"><div></div><div></div></div>
    </div>
  );
}

export default Spinner;
